contract FundMe{
    

    uint256 public  minimumUsd = 5;

    function fund() public payable {
        require(msg.value >=minimumUsd, "didn't send enough");
    

    }
        function getPrice() public {
            // address  0x694AA1769357215DE4FAC081bf1f309aDC325306
